                    new { id = "3021", name = "William", orgin = "German", gender = "Male", meaning = "William comes ultimately from the given name Wilhelm (cf. Old German Wilhelm > German Wilhelm and Old Norse Vilhjálmr). The Anglo-Saxon form should be *Wilhelm as well (although the Anglo-Saxon chronicle refers to William the Conqueror as Willelm). That is a compound of two distinct elements : wil = 'will or desire'; helm; Old English helm 'helmet, protection'; > English helm 'knight's large helmet'. In fact, William is from the Old Norman form Williame, because the English language should have retained helm. The development to -iam is the result of the diphthongation [iaʷ] + [m] in Old Norman-French, quite similar in Old Central French [eaʷ] + [m] from an early Gallo-Romance form WILLELMU. This development can be followed in the different versions of the name in the Wace's Roman de Rou. The spelling and phonetics Wi- [wi] is a characteristic trait of the Northern French dialects, but the pronunciation changed in Norman from [wi] to [vi] in the 12th century (cf. the Norman surnames Villon and Villamaux 'little William'), unlike the Central French and Southern Norman that turned the Germanic Wi- into Gui- [gwi] > [gi]. The Modern French spelling is Guillaume. The first well-known carrier of the name was Charlemagne's cousin William of Gellone, a.k.a. Guilhelm, William of Orange, Guillaume Fierabrace, or William Short-Nose (755–812). This William is immortalized in the Chanson de Guillaume and his esteem may account for the name's subsequent popularity among European nobility. Also, the shortahnd 'Will' is something people make when they want to distribute assests when they die." },
